class Solution {

    /**
     * Calculates the number of distinct prime factors of a number.
     *
     * @param Integer $num The number to calculate prime factors for.
     * @return Integer The number of distinct prime factors.
     */
    private function primeFactorsCount($num) {
        $count = 0;
        for ($i = 2; $i * $i <= $num; $i++) {
            if ($num % $i == 0) {
                $count++;
                while ($num % $i == 0) {
                    $num /= $i;
                }
            }
        }
        if ($num > 1) $count++;
        return $count;
    }

    /**
     * @param Integer[] $nums Array of positive integers.
     * @param Integer $k The maximum number of operations.
     * @return Integer The maximum possible score modulo 10^9 + 7.
     */
    function maximumScore($nums, $k) {
        $mod = 1000000007;
        $n = count($nums);
        $scores = array_map([$this, 'primeFactorsCount'], $nums);
        $maxScore = 1;

        // Sort $nums alongside $scores to prioritize larger numbers with the same prime factors count
        array_multisort($scores, SORT_DESC, $nums, SORT_DESC);

        for ($i = 0; $i < min($k, $n); $i++) {
            $maxScore = ($maxScore * $nums[$i]) % $mod;
        }

        return $maxScore;
    }
}
